insert into PRD_BANKFINANCE values (null, '00045895', '2012年“金葵花”招银进宝之点贷成金1014号理财计划101894', '招商银行', '人民币', '52天', '2012-10-09', '2012-09-29', '2012-10-08', '52天', '4.2', '组合型', '5 万元', '浮动收益型', '宁波,长沙,哈尔滨,深圳', '10000', '无', '否', '', '银行有权提前终止，投资者无提前终止权。', '本理财计划投资于AA级(含)以上信用级别高,流动性好的银行间市场流通债券，信托计划，银行存款等其他金融资产。投资比例区间：债券资产、银行存款：30%—100% ；其他资产不高于70%。', '预期年化收益率为4.20%',0, null,'2012-09-27 11:38:40.767362');
insert into PRD_BANKFINANCE values (null, '00045659', '太阳聚富108号人民币94天产品', '广州农商银行', '人民币', '94天', '2012-10-09', '2012-09-29', '2012-10-08', '94天', '4.0', '票据型', '5 万元', '浮动收益型', '全国', '10000', '超过预期最高年化收益率部分作为服务费用。', '否', '', '1、银行有提前终止权。2、投资者无提前终止权。', '产品募集资金投资于符合国家政策的金融工具，包括但不限于现金、国债、金融债、央行票据、企业债、公司债、短期融资券、中期票据、债券回购、同业拆借、存放同业等投资工具。该产品为非保本浮动收益型，投资者主要面临信用风险：如果相关债券发行人或借款人未能按时足额支付本金和收益，投资者的收益将受到不利影响甚至本金受到损失。该产品适合稳健型投资者。', '产品到期年化收益率为4.00%。',0, null,'2012-09-27 11:38:42.100836');
insert into PRD_BANKFINANCE values (null, '00045660', '“太阳添富3号10期”人民币22天滚动型产品', '广州农商银行', '人民币', '22天', '2012-10-08', '2012-09-29', '2012-10-07', '22天', '3.5', '票据型', '5 万元', '浮动收益型', '全国', '10000', '超过预期最高年化收益率部分作为服务费用。', '否', '', '1、银行有提前终止权。2、投资者无提前终止权。', '广州农村商业银行将募集资金投资于符合国家政策的金融工具，包括但不限于现金、国债、金融债、央行票据、企业债、公司债、短期融资券、中期票据、债券回购、同业拆借、存放同业等投资工具。 产品到期保障本金，主要面临信用风险：投资者面临债券或票据发行人、存放同业款项和理财产品到期不能及时兑付的信用风险。该产品适合稳健型投资者。', '在投资于基础资产的本金和获得利息按时足额回收的情况下，本理财产品持有到期的预期年化收益率为3.50%。',0, null,'2012-09-27 11:38:42.975461');
insert into PRD_BANKFINANCE values (null, '00045661', '“太阳添富季季盈A”人民币81天滚动型产品(9.29-10.7)', '广州农商银行', '人民币', '81天', '2012-10-08', '2012-09-29', '2012-10-07', '81天', '4.0', '票据型', '5 万元', '浮动收益型', '全国', '10000', '超过预期最高年化收益率部分作为服务费用。', '否', '', '1、银行有提前终止权。2、投资者无提前终止权。', '广州农村商业银行将募集资金投资于符合国家政策的金融工具，包括但不限于现金、国债、金融债、央行票据、企业债、公司债、短期融资券、中期票据、债券回购、同业拆借、存放同业等投资工具。 产品到期保障本金，主要面临信用风险：投资者面临债券或票据发行人、存放同业款项和理财产品到期不能及时兑付的信用风险。该产品适合稳健型投资者。', '在投资于基础资产的本金和获得利息按时足额回收的情况下，本理财产品持有到期的预期年化收益率为4.00%。',0, null,'2012-09-27 11:38:44.379250');
insert into PRD_BANKFINANCE values (null, '00045687', '“百合理财”1093号假日满福系列（中秋?国庆节）理财计划产品（保本型）', '兰州银行', '人民币', '100天', '2012-10-10', '2012-09-29', '2012-10-09', '100天', '4.2', '票据型', '5 万元', '浮动收益型', '全国', '10000', '理财计划投资收益率超过预期收益部分为银行管理费。', '否', '', '1.投资者无权提前终止该产品。2.银行有权按照项目投资实际情况，提前终止该产品。', '该产品资金由投资管理人主要投资于银行间市场债券、同业存款、各类货币市场工具，投资比例30%至100%；其他资产不高于70%。该产品为保本浮动收益型。兰州银行对该产品的风险评级为R1，风险程度低，适合保守型投资者。', '产品的预期年收益率为4.20%。',0, null,'2012-09-27 11:38:45.161116');
insert into PRD_BANKFINANCE values (null, '00045688', '“百合理财”1094号假日满福系列（中秋?国庆节）理财计划产品', '兰州银行', '人民币', '100天', '2012-10-10', '2012-09-29', '2012-10-09', '100天', '4.7', '票据型', '5 万元', '浮动收益型', '全国', '10000', '理财计划投资收益率超过预期收益部分为银行管理费。', '否', '', '1.投资者无权提前终止该产品。2.银行有权按照项目投资实际情况，提前终止该产品。', '该产品资金由投资管理人主要投资于银行间市场债券、同业存款、各类货币市场工具，投资比例30%至100%；其他资产不高于70%。该产品为非保本浮动收益型，兰州银行对该产品的风险评级为R2，风险程度较低，适合稳健型投资者。', '产品的预期年收益率为4.70%。',0, null,'2012-09-27 11:38:46.529062');
insert into PRD_BANKFINANCE values (null, '00045690', '“聚财宝”专享灵活添利（非保本）2012年72期人民币理财产品（平）', '平安银行（原）', '人民币', '51天', '2012-10-10', '2012-09-29', '2012-10-09', '51天', '4.5', '票据型', '5 万元', '浮动收益型', '全国', '1000', '超过预期最高年化收益率的收益部分作为平安银行的手续费。', '否', '', '1.银行根据市场情况可以到期终止或者提前终止本理财产品。2.理财期内，投资者无提前终止本理财计划的权利。', '产品募集资金投资于银行间市场信用等级较高、流动性较好的债券以及货币市场工具。该产品为非保本浮动收益型，投资者主要面临信用风险，即债券发行人的信用违约事件可能会使投资者的收益及本金受到影响。经平安银行风险承受度评估，适合评定为“激进型”、“进取型”、“平衡型”、“稳健型”的投资者。', '根据当期可投资资产收益率，扣除产品的成本，本期理财产品持有到期年化收益率为4.50%。',0, null,'2012-09-27 11:38:49.744060');
insert into PRD_BANKFINANCE values (null, '00045462', '“聚财宝”组合类（和盈计划）2012年114期人民币理财产品（平）', '平安银行（原）', '人民币', '53天', '2012-10-08', '2012-09-29', '2012-10-07', '53天', '4.7', '组合型', '5 万元', '浮动收益型', '全国', '10000', '超过预期最高年化收益率的收益部分作为深圳发展银行的手续费。', '否', '', '理财期内，投资者无提前终止本理财计划的权利。平安银行对本产品保留：根据市场情况选择在理财期内任一天提前终止产品的权利，以及在产品到期日延期结束产品的权利。', '产品主要投资于市场信用等级较高的债券、货币市场工具、同业资产、符合监管机构要求的信托计划和资产受益权（非股权类、房地产、PE类、信托受益权类）以及其他资产。该产品为非保本浮动收益型，经平安银行风险承受度评估，适合评定为“激进型”、“进取型”、“平衡型”、“稳健型”的投资者。', '根据当期可投资资产收益率，扣除产品的成本，本期理财产品预期最高年化收益率为4.70%。',0, null,'2012-09-27 11:38:51.134566');
insert into PRD_BANKFINANCE values (null, '00045758', '2012年“金葵花”-招银进宝之点贷成金988号理财计划101868', '招商银行', '人民币', '77天', '2012-10-09', '2012-09-29', '2012-10-08', '77天', '4.3', '组合型', '5 万元', '浮动收益型', '天津,重庆,武汉,青岛', '10000', '无', '否', '', '银行有权提前终止，投资者无提前终止权。', '本理财计划投资于AA级(含)以上信用级别高,流动性好的银行间市场流通债券，信托计划，银行存款等其他金融资产。投资比例区间：债券资产、银行存款：30%—100% ；其他资产不高于70%。', '预期年化收益率为4.30%',0, null,'2012-09-27 11:38:53.091984');
insert into PRD_BANKFINANCE values (null, '00045531', '“金钥匙·安心得利”2012第1903期人民币理财产品', '农业银行', '人民币', '35天', '2012-10-08', '2012-09-29', '2012-10-07', '35天', '3.55', '组合型', '5 万元', '浮动收益型', '全国', '10000', '无', '否', '', '银行有权提前终止，客户不可赎回', '本理财产品资金由资产管理人主要投资于国债、金融债、央行票据、回购、较高信用等级的信用债（包括但不限于企业债、公司债、中期票据、短期融资券、超短期融资券）、交易所债券、非公开定向债务融资工具、可转债、同业存款、同业借款等低风险同业资金业务、通过掉期锁定风险的本、外币货币资金市场工具、投资类信托计划（通过信托计划投资于同业存款、债券等品种）、委托类资产、债权类资产受益权、前期已成立的优质企业信托融资项目，以及其他符合监管要求的投资品种。本理财产品类型非保本浮动收益型，产品适合风险承受能力为谨慎型、稳健型、进取型和激进型的投资者', '扣除各项费用后，预期最高年化收益率3.55%',0, null,'2012-09-27 11:38:54.096561');
insert into PRD_BANKFINANCE values (null, '00045532', '“金钥匙·安心得利”2012第1904期人民币理财产品', '农业银行', '人民币', '63天', '2012-10-08', '2012-09-29', '2012-10-07', '63天', '3.7', '组合型', '5 万元', '浮动收益型', '全国', '10000', '无', '否', '', '银行有权提前终止，客户不可赎回', '本理财产品资金由资产管理人主要投资于国债、金融债、央行票据、回购、较高信用等级的信用债（包括但不限于企业债、公司债、中期票据、短期融资券、超短期融资券）、交易所债券、非公开定向债务融资工具、可转债、同业存款、同业借款等低风险同业资金业务、通过掉期锁定风险的本、外币货币资金市场工具、投资类信托计划（通过信托计划投资于同业存款、债券等品种）、委托类资产、债权类资产受益权、前期已成立的优质企业信托融资项目，以及其他符合监管要求的投资品种。本理财产品类型非保本浮动收益型，产品适合风险承受能力为谨慎型、稳健型、进取型和激进型的投资者', '预期最高年化收益率（扣除各项费用后）3.70%',0, null,'2012-09-27 11:38:55.140208');
insert into PRD_BANKFINANCE values (null, '00045533', '“金钥匙·安心得利”2012第1905期人民币理财产品', '农业银行', '人民币', '84天', '2012-10-08', '2012-09-29', '2012-10-07', '84天', '3.75', '组合型', '5 万元', '浮动收益型', '全国', '10000', '无', '否', '', '银行有权提前终止，客户不可赎回', '本理财产品资金由资产管理人主要投资于国债、金融债、央行票据、回购、较高信用等级的信用债（包括但不限于企业债、公司债、中期票据、短期融资券、超短期融资券）、交易所债券、非公开定向债务融资工具、可转债、同业存款、同业借款等低风险同业资金业务、通过掉期锁定风险的本、外币货币资金市场工具、投资类信托计划（通过信托计划投资于同业存款、债券等品种）、委托类资产、债权类资产受益权、前期已成立的优质企业信托融资项目，以及其他符合监管要求的投资品种。本理财产品类型非保本浮动收益型，产品适合风险承受能力为谨慎型、稳健型、进取型和激进型的投资者', '预期最高年化收益率（扣除各项费用后）3.75%',0, null,'2012-09-27 11:38:56.605182');
