/*!40101 SET NAMES utf8 */;insert into PRD_BANKFINANCE values (null, '00045519', '“金钥匙·本利丰”2012年第268期人民币理财产品', '农业银行', '人民币', '35天', '2012-10-08', '2012-10-06', '2012-10-07', '35天', '3.2', '组合型', '5 万元', '固定收益型', '全国', '10000', '托管费：0.05%/年，由托管人按日收取。管理费：0.20%/年。无认购费、申购费、赎回费。', '否', '', '银行有权提前终止，客户不可赎回', '本理财产品资金由资产管理人主要投资于国债、金融债、央行票据、回购、高信用等级的信用债、委托类资产、前期已成立的优质企业信托融资项目，投资类信托计划（通过信托计划投资于同业存款、债券等品种），以及其他符合监管要求的投资品种。本理财产品类型为保本保证收益型，产品适合风险承受能力为保守型、谨慎型、稳健型、进取型和激进型的投资者', '预期最高年化收益率（扣除各项费用后）3.20%',0, null,'2012-09-27 11:38:14.725475');
